import React from 'react';

export default function Nav(props) {
  return (
    <nav class="folder-menu">
        <div class="folder-menu-list-item profile">
            <a href="/profile">PROFILE</a>
        </div>
        <ul class="folder-menu-list">
            <li class="folder-menu-list-item kitchen">
                <a href="/inbox">KITCHEN</a>
            </li>
            <li class="folder-menu-list-item meals">
                <a href="/spam">MEALS</a>
            </li>
        </ul>
    </nav>
  );
}
